import './App.css'
import Home from './pages/Home'
import { useRef, useEffect } from 'react'
import fhirDepartment1 from '../src/pix/fhir1.png'

const App = _ => {
  const img1 = useRef()
  useEffect(_ => {
    setTimeout(_ => {
      img1.current.style.height = '0px'
      setTimeout(_ => img1.current.style.display = 'none', 1005)
    }, 1000)
  }, [])
  return (
    <>
      <img ref={img1} src={fhirDepartment1} alt='FHIR department' />
      <Home />
    </>
  )
}

export default App
